import { useState } from "react";

const BuyingProcess = ({ barcode }) => {
    const [qty, setQty] = useState(1);

    return (
        <form>
            <label>
                الكمية:
                <input 
                    type="number" 
                    required 
                    value={qty} 
                    onChange={(e) => setQty(e.target.value)}
                    className="ms-3 w-10 text-center rounded border border-main-color"
                />
            </label>
            <button className="block w-full bg-green-600 font-b">إتمام الشراء</button>
        </form>
    );
}

export default BuyingProcess;
